import React from 'react';
import NavBar from '../components/NavBar'
import { Button } from '@mui/material';
import { authFetch } from '../auth/AuthFunctions'
import { ThirtyFpsRounded } from '@mui/icons-material';

class Home extends React.Component {

    constructor(props) {
        super(props);
        this.testProtected = this.testProtected.bind(this.testProtected);
    }

    async testProtected() {
        const resp = authFetch('/api/protected');
        logger.console(resp);
    }

    render() {
        return (
            <div>
                <NavBar />
                <h2>Home Page</h2>
                <Button onClick={testProtected}></Button>
            </div>
        )
    }
}

export default Home;
